import { StyleSheet, Platform } from 'react-native';

const styles = StyleSheet.create({
    container: {
      flex: 2,
      alignItems: 'flex-start',
      // justifyContent:'center',
      backgroundColor: '#610000',
      
    },
    largeHeading: {
        fontSize: 30,
        fontStyle: 'bold',
        paddingTop:'15%',
        paddingLeft:'40%',
        paddingRight:'40%',
        textAlign:'center',
        ...Platform.select({
          ios: {
            color: 'yellow',
          },
          default: {
            color: 'white'
          }
        }),
    },
    listContainer: {
        flexGrow: 0,
        flexShrink: 0
    },
    subtitle:{
      color:'white',
      fontSize:16,
      textAlign:'center',
      paddingLeft:'33%',
      paddingRight:'33%'
    },
    displayOS:{
      paddingLeft:'45%',
      paddingRight:'45%',
      ...Platform.select({
        ios:{
          color:'white',
        },
          default:{
            color:'yellow'
          }
        }),
      },
      button:{
        paddingTop:'2%',
        paddingLeft:'45%'
      }
    },
);

  export default styles;
